import StreamKeyManager from './StreamKeyManager';

function App() {
  return (
    <div style={{ padding: 20, maxWidth: 900, margin: 'auto' }}>
      <h1>Multi-Streaming Platform Preview</h1>
      <StreamKeyManager />
    </div>
  );
}

export default App;
